insert  into `trace_cma`(`id`,`viewed`,`receipt_date`,`report_status`,`report_date`,`report_no`,`patient_name`,`patient_name_letter`,`patient_gender`,`patient_age`,`patient_no`,`speciman_no`,`speciman_type`,`contact_tel`,`department_name`,`diagnosis`,`doctor_advice`,`chip_id`,`report_tip`,`result`,`report_analysis_opinion`,`conclusion`,`conclusion_details`,`suggest`,`chromosome_region`,`dna_chip`,`result2`,`chromosome_region2`,`conclusion2`,`result3`,`chromosome_region3`,`conclusion3`,`result4`,`chromosome_region4`,`conclusion4`,`inspection_time`,`times_of_pregnancy`,`times_of_birth`,`sign_consent`,`apply_doctor`,`apply_date`,`remarks`,`create_time`,`create_user`,`update_time`,`update_user`) values (1478364767086931969,0,'2021-02-04','审核','2021-02-22','21BA0290','赵强','zq','男','28岁','0003982359','21020400873','外周血','13682348510','产前诊断科门诊','胎儿2q13存在拷贝数缺失80kb 3、Xp22.31拷贝数重复1.7Mb,新冠肺炎门诊筛查','array CGH(微阵列染色体比较基因组杂交技术-外周血)','21BA0290','结果异常',NULL,NULL,'意义不明','DNA芯片v1结果显示在2q13存在拷贝数缺失，大小为80kb，该缺失区域内有1个OMIM疾病致病基因，NPHP1(OMIM:607100)与肾消耗病相关。研究显示该基因的缺失可导致成年期发病的终末期肾病（ESRD）[PMID: 29654215]，临床表型包括多尿症、烦渴、轻度蛋白尿、纤维变性、多囊肾等，并与5-10%遗传性终末期肾病相关，60%的肾消耗病患者由该基因缺失导致[PMID: 26037636; 29949740]。父母验证显示系父源性遗传，是否有相关表型，请结合临床分析。','1. 产前遗传咨询;','arr[GRCh37]2q13 (110881663_110961923)x1',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2021-02-04 14:37:00',1,0,NULL,'贺小红','2021-02-04',NULL,'2022-01-04 21:56:42',1,'2022-01-04 23:19:00',1);
insert  into `trace_cma`(`id`,`viewed`,`receipt_date`,`report_status`,`report_date`,`report_no`,`patient_name`,`patient_name_letter`,`patient_gender`,`patient_age`,`patient_no`,`speciman_no`,`speciman_type`,`contact_tel`,`department_name`,`diagnosis`,`doctor_advice`,`chip_id`,`report_tip`,`result`,`report_analysis_opinion`,`conclusion`,`conclusion_details`,`suggest`,`chromosome_region`,`dna_chip`,`result2`,`chromosome_region2`,`conclusion2`,`result3`,`chromosome_region3`,`conclusion3`,`result4`,`chromosome_region4`,`conclusion4`,`inspection_time`,`times_of_pregnancy`,`times_of_birth`,`sign_consent`,`apply_doctor`,`apply_date`,`remarks`,`create_time`,`create_user`,`update_time`,`update_user`) values (1478364767212761090,0,'2021-02-04','审核','2021-02-22','21BA0291','邓秋婷','dqt','女','31岁','0004030455','21020400847','全血','13480890259','产前诊断科门诊','孕28+5周,胎儿2q13存在拷贝数缺失80kb,胎儿Xp22.31拷贝数重复1.7Mb,胎儿侧脑室增宽,新冠肺炎门诊筛查','基因芯片验证','21BA0291','结果异常',NULL,NULL,'意义不明','DNA芯片v1分析显示在Xp22.31区域发生拷贝数重复，重复大小为1.7Mb（对照为男性）。该重复区域内包含多个OMIM疾病致病基因，其中STS(OMIM:300747)与X-连锁鱼鳞病相关。文献报道显示，STS基因的男性重复（56%）遗传自表型正常的母亲，1例女性携带者遗传自表型正常的父亲，提示该基因的重复在欧美男性人群中可能为良性变异 [PMID:21739574]。该区域的重复在正常人群中的发生率为0.15%-0.41%[PMID:20132918; 21355048]，也有文献报道显示与该重复区域相关的临床表型包括癫痫、认知缺陷、孤独症[PMID:24800990]。DECIPHER有更小重复片段报道，表型包括：轻度到中度智力障碍、癫痫或睡眠障碍（Patient:268271；250671；278904），部分遗传自表型正常的父母，可能存在外显不全现象。芯片验证显示胎儿重复系母源性遗传。患者是否有相关表型，请结合临床进一步分析。','1. 产前遗传咨询；','arr[GRCh37]Xq22.31(6451784_8138039)x3',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2021-02-04 14:37:00',NULL,NULL,NULL,NULL,NULL,'复查','2022-01-04 21:56:42',1,'2022-01-04 23:19:00',1);
