insert  into `trace_cma`(`id`,`viewed`,`receipt_date`,`report_status`,`report_date`,`report_no`,`patient_name`,`patient_name_letter`,`patient_gender`,`patient_age`,`patient_no`,`speciman_no`,`speciman_type`,`contact_tel`,`department_name`,`diagnosis`,`doctor_advice`,`chip_id`,`report_tip`,`result`,`report_analysis_opinion`,`conclusion`,`conclusion_details`,`suggest`,`chromosome_region`,`dna_chip`,`result2`,`chromosome_region2`,`conclusion2`,`result3`,`chromosome_region3`,`conclusion3`,`result4`,`chromosome_region4`,`conclusion4`,`inspection_time`,`times_of_pregnancy`,`times_of_birth`,`sign_consent`,`apply_doctor`,`apply_date`,`remarks`,`create_time`,`create_user`,`update_time`,`update_user`) values (1478364768336834562,0,'2021-02-04','审核','2021-02-10','21BA0308','陈婷婷','ctt','女','27岁','0006424088','21020204036','羊水','13724221736','产前诊断科门诊','胎儿复杂性先心病（外院）,孕24周4天','arrayCGH(微阵列染色体比较基因组杂交技术)','21BA0308','结果异常',NULL,NULL,'异常结果','DNA芯片v1显示该样本在染色体22q11.21区域发生拷贝数缺失，缺失片段大小为2.4Mb。该区域为22q11.21微缺失综合征的关键区域，包含多个OMIM疾病致病基因，其中TBX1 (OMIM: 602054) 基因的缺失可导致心脏异常疾病。研究显示22q11.21缺失综合征 (OMIM:188400)为常染色体显性遗传的连续基因缺失综合征，93%的先证者为新发缺失，7%的患者遗传自父母，其临床表型可有：先天性心脏病（74%）， 包括法洛士四联症、主动脉弓断裂、室间隔缺损；上颚畸形（69%），学习困难（70-90%），免疫缺陷（77%），低血钙症（50%），肾脏畸形（31%），听力障碍，生长激素缺乏，癫痫，骨骼异常，中枢神经系统异常，眼科疾病 [PMID: 20301696]等。患者是否具有相关表型，请结合临床进行分析。','1. 产前遗传咨询。2. 父母芯片验证，确定其来源。','arr[GRCh37]22q11.21(18919187_21357982)x1',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2021-02-04 14:37:00',1,0,NULL,'杨晓华','2021-02-02',NULL,'2022-01-04 21:56:42',1,'2022-01-04 23:19:00',1);
