insert  into `trace_cma`(`id`,`viewed`,`receipt_date`,`report_status`,`report_date`,`report_no`,`patient_name`,`patient_name_letter`,`patient_gender`,`patient_age`,`patient_no`,`speciman_no`,`speciman_type`,`contact_tel`,`department_name`,`diagnosis`,`doctor_advice`,`chip_id`,`report_tip`,`result`,`report_analysis_opinion`,`conclusion`,`conclusion_details`,`suggest`,`chromosome_region`,`dna_chip`,`result2`,`chromosome_region2`,`conclusion2`,`result3`,`chromosome_region3`,`conclusion3`,`result4`,`chromosome_region4`,`conclusion4`,`inspection_time`,`times_of_pregnancy`,`times_of_birth`,`sign_consent`,`apply_doctor`,`apply_date`,`remarks`,`create_time`,`create_user`,`update_time`,`update_user`) values (1478364770236854274,0,'2021-02-05','审核','2021-02-22','21BA0337','邓俏运','dqy','女','31岁','0000029367','21020303258','绒毛','13713847377','妇科门诊','稽留流产','arrayCGH(微阵列染色体比较基因组杂交技术)','21BA0337','结果异常',NULL,NULL,'异常结果','DNA芯片v1分析显示在染色体16p13.3q24.3存在拷贝数重复，代表整条16号染色体重复，提示为16三体综合征。16三体是自然流产中最常见的非整体异常，在所有妊娠中的发生率为1%-1.5%[PMID: 9741470]。16三体的患者无法存活，仅在嵌合体、16p或16q三体中有存活的病例报道[PMID: 12457405; 5814232]。16三体的临床表型包括宫内生长受限、唇腭裂、心脏畸形、肾脏发育不良和其他多器官畸形[PMID: 9741470]。减数分裂中染色体不分离可导致非整倍体的发生[PMID: 6234852; 2307459]。患者是否有相关表型，请结合临床进一步分析。','1. 遗传咨询。','arr[GRCh37]16p13.3q24.3(108855_90111267)x3',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2021-02-05 15:10:00',4,2,NULL,'欧亚梦兰','2021-02-03',NULL,'2022-01-04 21:56:43',1,'2022-01-04 23:19:01',1);
insert  into `trace_cma`(`id`,`viewed`,`receipt_date`,`report_status`,`report_date`,`report_no`,`patient_name`,`patient_name_letter`,`patient_gender`,`patient_age`,`patient_no`,`speciman_no`,`speciman_type`,`contact_tel`,`department_name`,`diagnosis`,`doctor_advice`,`chip_id`,`report_tip`,`result`,`report_analysis_opinion`,`conclusion`,`conclusion_details`,`suggest`,`chromosome_region`,`dna_chip`,`result2`,`chromosome_region2`,`conclusion2`,`result3`,`chromosome_region3`,`conclusion3`,`result4`,`chromosome_region4`,`conclusion4`,`inspection_time`,`times_of_pregnancy`,`times_of_birth`,`sign_consent`,`apply_doctor`,`apply_date`,`remarks`,`create_time`,`create_user`,`update_time`,`update_user`) values (1478364770303963138,0,'2021-02-05','审核','2021-02-22','21BA0338','车露','cl','女','28岁','0001244098','21013005452','绒毛','18318068343','产前诊断科门诊','胎儿颈部水囊瘤、全身水肿，小脑结构及后颅窝显示不清,孕12周2天','arrayCGH(微阵列染色体比较基因组杂交技术)','21BA0338','结果异常',NULL,NULL,'异常结果','DNA芯片v1分析显示在21q11.2q22.3区域发生拷贝数重复，重复大小为33.1Mb，显示有3条21号染色体，提示为21三体综合征（也称唐氏综合征，down syndrome, DS）。DS在新生儿中的发生率为1/600-1/800，是活产新生儿最常见的染色体异常之一，临床表型具有高度变异性。DS患儿常表现为智力低下和特殊的先天畸形：具有特殊面容，如眼距宽，鼻根扁平，眼裂小，舌胖等；90%的DS存在明显的传导性听力损伤[PMID:7881226]；30~40%出现心脏畸形，主要为房室间隔缺损[PMID:29218069]；还可出现十二指肠狭窄或闭锁、肛门闭锁和Hirschsprung病（便秘和腹胀等）[PMID: 8055322]；此外，DS患儿易发生白血病和白血病样反应，特别是急性巨核细胞白血病[PMID:12172547]。母亲高龄是患病的高危因素之一[PMID:8644722;27600794]。请结合临床分析。','1. 产前遗传咨询','arr[GRCh37]21q11.2q22.3 (15496955_48083634)x3',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2021-02-05 15:12:00',1,0,NULL,'杨晓华','2021-01-30',NULL,'2022-01-04 21:56:43',1,'2022-01-04 23:19:01',1);
