insert  into `trace_cma`(`id`,`viewed`,`receipt_date`,`report_status`,`report_date`,`report_no`,`patient_name`,`patient_name_letter`,`patient_gender`,`patient_age`,`patient_no`,`speciman_no`,`speciman_type`,`contact_tel`,`department_name`,`diagnosis`,`doctor_advice`,`chip_id`,`report_tip`,`result`,`report_analysis_opinion`,`conclusion`,`conclusion_details`,`suggest`,`chromosome_region`,`dna_chip`,`result2`,`chromosome_region2`,`conclusion2`,`result3`,`chromosome_region3`,`conclusion3`,`result4`,`chromosome_region4`,`conclusion4`,`inspection_time`,`times_of_pregnancy`,`times_of_birth`,`sign_consent`,`apply_doctor`,`apply_date`,`remarks`,`create_time`,`create_user`,`update_time`,`update_user`) values (1478364771411259393,0,'2021-02-05','审核','2021-03-05','21BA0355','冯嘉瑶','fjy','女','29岁','0001329692','21020504548','羊水','15889441935','产前诊断科门诊','胎儿肠管回声增强 永久右脐静脉,21三体临界风险,孕24周3天','arrayCGH(微阵列染色体比较基因组杂交技术)','21BA0355','结果异常',NULL,NULL,'意义不明','DNA芯片v1显示该样本在染色体1q21.1q21.2区域发生拷贝数缺失，缺失片段大小为1.2Mb。该区域内包含多个OMIM疾病致病基因，其中GJA5（OMIM：121013）为常染色体显性遗传方式，与家族性心房纤维性颤动有关（OMIM：614049）；GJA8（OMIM：600897）为常染色体显性遗传方式，与多发型白内障相关（OMIM：116200）。DECIPHER有更小缺失片段报道，有异常面容、智力障碍，遗传自表型正常的父母（Patient：252283）；孤独症（Patient：323120）是否具有相关表型，请结合临床进行分析。','1. 产前遗传咨询 ；2. 父母芯片验证，确定缺失来源。','arr[GRCh37]1q21.1q21.2(146591224_147824207)x1',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2021-02-05 17:21:00',1,0,NULL,'杨晓华','2021-02-05',NULL,'2022-01-04 21:56:43',1,'2022-01-04 23:19:01',1);
insert  into `trace_cma`(`id`,`viewed`,`receipt_date`,`report_status`,`report_date`,`report_no`,`patient_name`,`patient_name_letter`,`patient_gender`,`patient_age`,`patient_no`,`speciman_no`,`speciman_type`,`contact_tel`,`department_name`,`diagnosis`,`doctor_advice`,`chip_id`,`report_tip`,`result`,`report_analysis_opinion`,`conclusion`,`conclusion_details`,`suggest`,`chromosome_region`,`dna_chip`,`result2`,`chromosome_region2`,`conclusion2`,`result3`,`chromosome_region3`,`conclusion3`,`result4`,`chromosome_region4`,`conclusion4`,`inspection_time`,`times_of_pregnancy`,`times_of_birth`,`sign_consent`,`apply_doctor`,`apply_date`,`remarks`,`create_time`,`create_user`,`update_time`,`update_user`) values (1478364771478368257,0,'2021-02-05','审核','2021-02-26','21BA0356','潘艺妮','pyn','女','31岁','0005555646','21012903631','羊水','15220113676','产前诊断科门诊','孕17+4 周,不良孕产史（21-三体引产史）,无创升级版高风险','arrayCGH(微阵列染色体比较基因组杂交技术)','21BA0356','结果异常',NULL,NULL,'异常结果','DNA芯片v1分析显示在21q11.2q22.3区域发生拷贝数重复，重复大小为33.1Mb，显示有3条21号染色体，提示为21三体综合征（也称唐氏综合征，down syndrome, DS）。DS在新生儿中的发生率为1/600-1/800，是活产新生儿最常见的染色体异常之一，临床表型具有高度变异性。DS患儿常表现为智力低下和特殊的先天畸形：具有特殊面容，如眼距宽，鼻根扁平，眼裂小，舌胖等；90%的DS存在明显的传导性听力损伤[PMID:7881226]；30~40%出现心脏畸形，主要为房室间隔缺损[PMID:29218069]；还可出现十二指肠狭窄或闭锁、肛门闭锁和Hirschsprung病（便秘和腹胀等）[PMID: 8055322]；此外，DS患儿易发生白血病和白血病样反应，特别是急性巨核细胞白血病[PMID:12172547]。母亲高龄是患病的高危因素之一[PMID:8644722;27600794]。请结合临床分析。','1.产前遗传咨询；2. 父母核型检测，排除染色体易位。','arr[GRCh37]21q11.2q22.3 (15496955_48083634)x3',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2021-02-05 17:21:00',5,2,NULL,'钟丽娟','2021-01-29',NULL,'2022-01-04 21:56:43',1,'2022-01-04 23:19:01',1);
