insert  into `trace_cma`(`id`,`viewed`,`receipt_date`,`report_status`,`report_date`,`report_no`,`patient_name`,`patient_name_letter`,`patient_gender`,`patient_age`,`patient_no`,`speciman_no`,`speciman_type`,`contact_tel`,`department_name`,`diagnosis`,`doctor_advice`,`chip_id`,`report_tip`,`result`,`report_analysis_opinion`,`conclusion`,`conclusion_details`,`suggest`,`chromosome_region`,`dna_chip`,`result2`,`chromosome_region2`,`conclusion2`,`result3`,`chromosome_region3`,`conclusion3`,`result4`,`chromosome_region4`,`conclusion4`,`inspection_time`,`times_of_pregnancy`,`times_of_birth`,`sign_consent`,`apply_doctor`,`apply_date`,`remarks`,`create_time`,`create_user`,`update_time`,`update_user`) values (1478364773579714561,0,'2021-02-09','审核','2021-02-26','21BA0387','张艳莉','zyl','女','32岁','0000152253','21020901710','外周血','15602463316','产前诊断科门诊','孕 21+5 周,羊水芯片Xq12q13.1重复','array CGH(微阵列染色体比较基因组杂交技术-外周血)','21BA0387','结果异常',NULL,NULL,'意义不明','DNA芯片v1分析显示在Xq12q13.1区域发生拷贝数重复，重复大小为626kb（对照为男性）。该重复区域内包含1个OMIM疾病致病基因，OPHN1(OMIM:300127)基因变异与X-连锁智力障碍相关，可能伴有小脑发育不良、早期肌张力减退、言语发育落后、偶发性癫痫等。文献报道显示该基因的重复患者有运动缺陷、智力障碍、癫痫等表型，遗传自表型正常的母亲[PMID: 18512229]，还有先天性膈疝表型的报道[PMID: 21782985]。芯片验证显示胎儿重复遗传自母亲，是否有相关表型，请结合临床进一步分析。','1. 产前遗传咨询','arr[GRCh37]Xq12q13.1(67305523_67932336)x3',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2021-02-09 14:55:00',2,1,NULL,'钟丽娟','2021-02-09',NULL,'2022-01-04 21:56:43',1,'2022-01-04 23:19:01',1);
insert  into `trace_cma`(`id`,`viewed`,`receipt_date`,`report_status`,`report_date`,`report_no`,`patient_name`,`patient_name_letter`,`patient_gender`,`patient_age`,`patient_no`,`speciman_no`,`speciman_type`,`contact_tel`,`department_name`,`diagnosis`,`doctor_advice`,`chip_id`,`report_tip`,`result`,`report_analysis_opinion`,`conclusion`,`conclusion_details`,`suggest`,`chromosome_region`,`dna_chip`,`result2`,`chromosome_region2`,`conclusion2`,`result3`,`chromosome_region3`,`conclusion3`,`result4`,`chromosome_region4`,`conclusion4`,`inspection_time`,`times_of_pregnancy`,`times_of_birth`,`sign_consent`,`apply_doctor`,`apply_date`,`remarks`,`create_time`,`create_user`,`update_time`,`update_user`) values (1478364773642629122,0,'2021-02-09','审核','2021-03-05','21BA0388','汤嘉运','tjy','女','30岁','0000637819','21020705482','绒毛','13826837676','产前诊断科门诊','孕12+5周(外院,恒生),NT 4.85mm','arrayCGH(微阵列染色体比较基因组杂交技术)','21BA0388','结果异常',NULL,NULL,'意义不明','DNA芯片v1结果显示在2q13存在拷贝数缺失，大小为80kb，该缺失区域内有1个OMIM疾病致病基因，NPHP1(OMIM:607100)与肾消耗病相关。研究显示该基因的缺失可导致成年期发病的终末期肾病（ESRD）[PMID: 29654215]，临床表型包括多尿症、烦渴、轻度蛋白尿、纤维变性、多囊肾等，并与5-10%遗传性终末期肾病相关，60%的肾消耗病患者由该基因缺失导致[PMID: 26037636; 29949740]。是否有相关表型，请结合临床分析。','1. 产前遗传咨询;2. 父母芯片验证，确定缺失来源。','arr[GRCh37]2q13 (110881663_110961923)x1',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2021-02-09 14:58:00',3,1,NULL,'张锐','2021-02-07',NULL,'2022-01-04 21:56:43',1,'2022-01-04 23:19:01',1);
