insert  into `trace_cma`(`id`,`viewed`,`receipt_date`,`report_status`,`report_date`,`report_no`,`patient_name`,`patient_name_letter`,`patient_gender`,`patient_age`,`patient_no`,`speciman_no`,`speciman_type`,`contact_tel`,`department_name`,`diagnosis`,`doctor_advice`,`chip_id`,`report_tip`,`result`,`report_analysis_opinion`,`conclusion`,`conclusion_details`,`suggest`,`chromosome_region`,`dna_chip`,`result2`,`chromosome_region2`,`conclusion2`,`result3`,`chromosome_region3`,`conclusion3`,`result4`,`chromosome_region4`,`conclusion4`,`inspection_time`,`times_of_pregnancy`,`times_of_birth`,`sign_consent`,`apply_doctor`,`apply_date`,`remarks`,`create_time`,`create_user`,`update_time`,`update_user`) values (1478364774833811458,0,'2021-02-10','审核','2021-03-05','21BA0406','张春梅','zcm','女','39岁','0000734064','21021003811','绒毛','13128827351','产前诊断科门诊','稽留流产（外院）','arrayCGH(微阵列染色体比较基因组杂交技术)','21BA0406','结果异常',NULL,NULL,'异常结果','DNA芯片v1分析显示在Xp22.3q28区域发生拷贝数重复嵌合，大小为151M。在Yp11.32q12区域发生拷贝数缺失嵌合，大小为59Mb（对照为男性），经过QF-PCR验证，确认该样本为三倍体。三倍体（69条染色体）是致死性的染色体数目异常，占所有妊娠的2%-3%，在染色体异常的孕早期流产中占20%，大部分的三倍体胎儿流产发生在孕第7周至第17周之间[PMID:28790549]。三倍体有不同的出生缺陷症状，包括严重的宫内发育迟缓、面部畸形、小颌畸形、唇腭裂、心脏畸形、神经管缺陷、肾脏畸形、肢体畸形和单脐动脉等[PMID:6683705;7316468]。三倍体大部分是由于双精入卵造成，也可由双雄受精或双雌受精致病[PMID:9583043]。请结合临床进一步分析。','1. 遗传咨询','arr[GRCh37]Xp22.33q28(2854502_154840775)x 1~2',NULL,NULL,'arr[GRCh37]Yp11.32q12(143058_59357161)x 0~1',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2021-02-10 15:45:00',4,1,NULL,'潘蕾','2021-02-10',NULL,'2022-01-04 21:56:44',1,'2022-01-04 23:19:02',1);
insert  into `trace_cma`(`id`,`viewed`,`receipt_date`,`report_status`,`report_date`,`report_no`,`patient_name`,`patient_name_letter`,`patient_gender`,`patient_age`,`patient_no`,`speciman_no`,`speciman_type`,`contact_tel`,`department_name`,`diagnosis`,`doctor_advice`,`chip_id`,`report_tip`,`result`,`report_analysis_opinion`,`conclusion`,`conclusion_details`,`suggest`,`chromosome_region`,`dna_chip`,`result2`,`chromosome_region2`,`conclusion2`,`result3`,`chromosome_region3`,`conclusion3`,`result4`,`chromosome_region4`,`conclusion4`,`inspection_time`,`times_of_pregnancy`,`times_of_birth`,`sign_consent`,`apply_doctor`,`apply_date`,`remarks`,`create_time`,`create_user`,`update_time`,`update_user`) values (1478364774896726017,0,'2021-02-10','审核','2021-03-05','21BA0407','雷成凤','lcf','女','26岁','0001268147','21021003037','绒毛','13530298585','妇科门诊','稽留流产','arrayCGH(微阵列染色体比较基因组杂交技术)','21BA0407','结果异常',NULL,NULL,'异常结果','DNA芯片v1分析显示在13q12.11q34区域发生拷贝数重复，重复大小为95Mb ，显示有3条13号染色体，提示为13三体。13三体嵌合体在孕期可导致胎儿早期流产、NT增厚[PMID:11399881]。产前临床表型包括有全前脑、复杂的Dandy-Walker畸形、水囊瘤、面裂、泌尿系统畸形[PMID：29241931]，产后可有重度智力障碍、严重发育迟缓、小头畸形、低位耳、唇腭裂、先天性心脏病等表型[PMID: 28266126]。患者是否有相关表型，请结合临床分析。','1. 遗传咨询','arr[GRCh37]13q12.11q34(19591690_115092576)x3',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2021-02-10 15:45:00',2,0,NULL,'沈丹婷','2021-02-10',NULL,'2022-01-04 21:56:44',1,'2022-01-04 23:19:02',1);
