insert  into `trace_cma`(`id`,`viewed`,`receipt_date`,`report_status`,`report_date`,`report_no`,`patient_name`,`patient_name_letter`,`patient_gender`,`patient_age`,`patient_no`,`speciman_no`,`speciman_type`,`contact_tel`,`department_name`,`diagnosis`,`doctor_advice`,`chip_id`,`report_tip`,`result`,`report_analysis_opinion`,`conclusion`,`conclusion_details`,`suggest`,`chromosome_region`,`dna_chip`,`result2`,`chromosome_region2`,`conclusion2`,`result3`,`chromosome_region3`,`conclusion3`,`result4`,`chromosome_region4`,`conclusion4`,`inspection_time`,`times_of_pregnancy`,`times_of_birth`,`sign_consent`,`apply_doctor`,`apply_date`,`remarks`,`create_time`,`create_user`,`update_time`,`update_user`) values (1478364777216176129,0,'2021-02-22','审核','2021-03-08','21BA0442','李喻','ly','女','41岁','0000702780','21020705679','绒毛','13510158565','产前诊断科门诊','夫妇高龄,孕11周4天,胎儿NT0.33cm,地贫筛查异常','arrayCGH(微阵列染色体比较基因组杂交技术)','21BA0442','结果异常',NULL,NULL,'异常结果','DNA芯片v1分析显示在21q11.2q22.3区域发生拷贝数重复，重复大小为33.1Mb，显示有3条21号染色体，提示为21三体综合征（也称唐氏综合征，down syndrome, DS）。DS在新生儿中的发生率为1/600-1/800，是活产新生儿最常见的染色体异常之一，临床表型具有高度变异性。DS患儿常表现为智力低下和特殊的先天畸形：具有特殊面容，如眼距宽，鼻根扁平，眼裂小，舌胖等；90%的DS存在明显的传导性听力损伤[PMID:7881226]；30~40%出现心脏畸形，主要为房室间隔缺损[PMID:29218069]；还可出现十二指肠狭窄或闭锁、肛门闭锁和Hirschsprung病（便秘和腹胀等）[PMID: 8055322]；此外，DS患儿易发生白血病和白血病样反应，特别是急性巨核细胞白血病[PMID:12172547]。母亲高龄是患病的高危因素之一[PMID:8644722;27600794]。请结合临床具体分析。','1. 产前遗传咨询','arr[GRCh37]21q11.2q22.3(14988644_48083634)x3',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2021-02-22 15:00:00',2,1,NULL,'杨晓华','2021-02-07',NULL,'2022-01-04 21:56:44',1,'2022-01-04 23:19:02',1);
