insert  into `trace_cma`(`id`,`viewed`,`receipt_date`,`report_status`,`report_date`,`report_no`,`patient_name`,`patient_name_letter`,`patient_gender`,`patient_age`,`patient_no`,`speciman_no`,`speciman_type`,`contact_tel`,`department_name`,`diagnosis`,`doctor_advice`,`chip_id`,`report_tip`,`result`,`report_analysis_opinion`,`conclusion`,`conclusion_details`,`suggest`,`chromosome_region`,`dna_chip`,`result2`,`chromosome_region2`,`conclusion2`,`result3`,`chromosome_region3`,`conclusion3`,`result4`,`chromosome_region4`,`conclusion4`,`inspection_time`,`times_of_pregnancy`,`times_of_birth`,`sign_consent`,`apply_doctor`,`apply_date`,`remarks`,`create_time`,`create_user`,`update_time`,`update_user`) values (1478364778646433793,0,'2021-02-23','审核','2021-03-08','21BA0464','陈洪','ch','女','35岁','0000539118','21022304684','羊水','13928487288','产前诊断科门诊','孕17周,孕妇高龄,无创性染色体数目偏多,α地贫：-α3.7/αα','arrayCGH(微阵列染色体比较基因组杂交技术)','21BA0464','结果异常',NULL,NULL,'异常结果','芯片结果显示X染色体有2个拷贝数重复，Y染色体有1个拷贝数（对照为男性），提示为XXY综合征（Klinefelter综合征），该综合征是最常见的性染色体疾病之一，男性新生儿中发生率为1/600，表型包括行为、交往、认知困难，成年后有小睾丸、促性腺激素分泌过多导致的性腺机能减退、身材高（类无睾者体型）等，症状可从接近正常到明显患病[PMID:23345262]。请结合临床进一步分析。','1.产前遗传咨询','arr[GRCh37]Xp22.33q28(2854502_154840775)x2',NULL,NULL,'arr[GRCh37]Yp11.32q12(143058_59357161)x1',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2021-02-23 16:22:00',5,3,NULL,'邱洁','2021-02-23',NULL,'2022-01-04 21:56:45',1,'2022-01-04 23:19:03',1);
insert  into `trace_cma`(`id`,`viewed`,`receipt_date`,`report_status`,`report_date`,`report_no`,`patient_name`,`patient_name_letter`,`patient_gender`,`patient_age`,`patient_no`,`speciman_no`,`speciman_type`,`contact_tel`,`department_name`,`diagnosis`,`doctor_advice`,`chip_id`,`report_tip`,`result`,`report_analysis_opinion`,`conclusion`,`conclusion_details`,`suggest`,`chromosome_region`,`dna_chip`,`result2`,`chromosome_region2`,`conclusion2`,`result3`,`chromosome_region3`,`conclusion3`,`result4`,`chromosome_region4`,`conclusion4`,`inspection_time`,`times_of_pregnancy`,`times_of_birth`,`sign_consent`,`apply_doctor`,`apply_date`,`remarks`,`create_time`,`create_user`,`update_time`,`update_user`) values (1478364778713542657,0,'2021-02-23','审核','2021-03-19','21BA0465','林丽梅','llm','女','29岁','0002819958','21022304792','羊水','13480969829','产前诊断科门诊','孕18周,无创12号染色体片段缺失9.42MB','arrayCGH(微阵列染色体比较基因组杂交技术)','21BA0465','结果异常',NULL,NULL,'异常结果','DNA芯片v1分析显示在12p12.3p11.22存在拷贝数缺失，缺失大小为8.75Mb。该区域内包含多个OMIM疾病致病基因，其中ITPR2 (OMIM:600144)与无汗症相关；PTHLH (OMIM:168470)与身材矮小、短指症相关。PDE3A(OMIM:123805)基因与高血压和短指趾症有关；PYROXD1（OMIM：617220）基因与肌病有关；GYS2（OMIM：138571）基因与糖原储存病有关；ABCC9（OMIM：601439）基因与骨质疏松发育不良有关。有研究报道，在12p11.22p12.1区域内3.06Mb缺失家系患者表现为双侧严重的短指趾、身材矮小，隆胸和过早的骨骺融合，考虑PTHLH基因单倍体功能不全可能是该家族疾病的主要原因[PMID:31283647]。另一例包含SOX5基因的12p12.1片段缺失患者表现为全面发育迟缓，智力障碍，清炖运动障碍和多器官损伤，以及严重的神经发育障碍[PMID:23498568].是否有相关表型，请结合临床进一步分析。','1.产前遗传咨询，2.父母芯片和核型验证，确认缺失来源。','arr[GRCh37] 12p12.3p11.22(19385653_28134822)x1',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2021-02-23 16:22:00',4,0,NULL,'邱洁','2021-02-23',NULL,'2022-01-04 21:56:45',1,'2022-01-04 23:19:03',1);
