insert  into `trace_cma`(`id`,`viewed`,`receipt_date`,`report_status`,`report_date`,`report_no`,`patient_name`,`patient_name_letter`,`patient_gender`,`patient_age`,`patient_no`,`speciman_no`,`speciman_type`,`contact_tel`,`department_name`,`diagnosis`,`doctor_advice`,`chip_id`,`report_tip`,`result`,`report_analysis_opinion`,`conclusion`,`conclusion_details`,`suggest`,`chromosome_region`,`dna_chip`,`result2`,`chromosome_region2`,`conclusion2`,`result3`,`chromosome_region3`,`conclusion3`,`result4`,`chromosome_region4`,`conclusion4`,`inspection_time`,`times_of_pregnancy`,`times_of_birth`,`sign_consent`,`apply_doctor`,`apply_date`,`remarks`,`create_time`,`create_user`,`update_time`,`update_user`) values (1478364780034748418,0,'2021-02-24','审核','2021-03-19','21BA0485','吴玉林','wyl','女','20岁','0004274138','21022403932','绒毛','13048923203','产前诊断科门诊','孕 13周,夫妻α地贫：--sea/αα','arrayCGH(微阵列染色体比较基因组杂交技术)','21BA0485','结果异常',NULL,NULL,'异常结果','DNA芯片v1分析显示在17p12区域发生拷贝数缺失，缺失大小为1.29Mb。该缺失区域内包含多个OMIM疾病致病基因，其中COX10(OMIM:602125)基因与婴儿期肥厚性心肌病相关[PMID: 23849775; PMID: 12928484]。PMP22（OMIM：601097）基因与Roussy-Levy综合症、Charcot-Marie-Tooth病和Dejerine-Sottas病有关，这3种疾病为腓骨肌萎缩症，部分临床表型相似或重叠[PMID:4467779]，其中Roussy-Levy综合症主要临床表现是：患者在儿童期和青少年期发病，站立不稳，蹒跚步态，双下肢肌无力，膝踝反射消失，腓骨肌萎缩，手活动不灵活及无力，手震颤，振动觉损害，伴有弓形足及脊柱侧凸。没有典型的小脑征及眼球震颤, 病程缓慢进展[PMID:5834704]。Charcot-Marie-Tooth病以外周神经疾病为特征[PMID:24136616]。Dejerine-Sottas病是指一种发病早的严重脱髓鞘神经病变，此外还表现为神经传导速度显著减慢，脑脊液中蛋白质含量高等[PMID:21840889]。请结合临床进一步分析。','1.产前遗传咨询，2.父母芯片验证，确认缺失来源。','arr[GRCh37] 17p12(14083270_15370699)x1',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2021-02-24 17:13:00',2,0,NULL,'钟丽娟','2021-02-24',NULL,'2022-01-04 21:56:45',1,'2022-01-04 23:19:03',1);
